package app.controllers;import app.model.UserDto;import app.services.UserService;import io.jooby.Context;import io.reactivex.rxjava3.core.Single;import jakarta.inject.Inject;import jakarta.inject.Singleton;import java.util.List;@Singletonpublic class UserController {    @Inject    UserService userService;    public Single<List<UserDto>> GetUsers(Context context) {        return this.userService.GetUsers();    }}